// ================================================================= slick page index
if ($('.features .reviews__list').length) {
  reviewListSlick();
}

$(window).resize(function () {
  if ($('.features .reviews__list').length) {
    reviewListSlick();
  }
})

function reviewListSlick() {
  $('.features .reviews__list').slick({
    accessibility: false,
    arrows: false,
    dots: true,
    appendDots: $('.reviews__dots'),
    dotsClass: 'reviews__dots-list',
    responsive: [{
      breakpoint: 577,
      settings: "unslick"
    }]
  });  
}






